import React from 'react'
import ReactDOM from 'react-dom'

function Student(){
    const Students={
        name : "Name",
        RegdNo : "0123"
    }
    return <p>Welcome : {Students.RegdNo}</p>
}

ReactDOM.render(
    <Student/>,
    document.getElementById('root')
)
